import React, { Component } from "react";
import { FacebookProvider, Page } from "react-facebook";

const SocialFeedFB = () => {
	return (
		<FacebookProvider appId="855434338435342">
			<Page href="https://www.facebook.com" tabs="timeline" />
		</FacebookProvider>
	);
};

export default SocialFeedFB;
